
<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>HunterPrice AI | Market Intelligence</title>
    <!-- Fuente Inter para look profesional -->
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600;800&display=swap" rel="stylesheet">
    <style>
        :root {
            --bg-body: #0f172a;
            --bg-card: #1e293b;
            --bg-header: #1e293b;
            --text-main: #f8fafc;
            --text-muted: #94a3b8;
            --accent-primary: #3b82f6; /* Blue 500 */
            --accent-success: #22c55e; /* Green 500 */
            --accent-warning: #eab308; /* Yellow 500 */
            --border-color: #334155;
        }
        
        * { box-sizing: border-box; }
        
        body { 
            font-family: 'Inter', sans-serif; 
            background-color: var(--bg-body); 
            color: var(--text-main); 
            margin: 0; 
            padding-bottom: 50px;
        }

        /* Header Profesional */
        .navbar {
            background-color: var(--bg-header);
            border-bottom: 1px solid var(--border-color);
            padding: 15px 20px;
            position: sticky;
            top: 0;
            z-index: 100;
            display: flex;
            justify-content: center;
            align-items: center;
            box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.3);
        }
        
        .brand { 
            font-weight: 800; 
            font-size: 1.5rem; 
            letter-spacing: -0.05em;
            background: linear-gradient(to right, #60a5fa, #3b82f6);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
        }

        /* Contenedor Principal */
        .container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 20px;
        }

        /* Buscador */
        .search-wrapper {
            margin: 30px 0;
            position: relative;
        }
        .search-input {
            width: 100%;
            padding: 16px 24px;
            background: var(--bg-card);
            border: 1px solid var(--border-color);
            border-radius: 12px;
            color: white;
            font-size: 1.1rem;
            transition: all 0.2s;
            box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1);
        }
        .search-input:focus {
            outline: none;
            border-color: var(--accent-primary);
            box-shadow: 0 0 0 3px rgba(59, 130, 246, 0.3);
        }

        /* Grid de Resultados */
        .results-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(350px, 1fr));
            gap: 20px;
        }

        /* Tarjeta de Producto */
        .product-card {
            background: var(--bg-card);
            border: 1px solid var(--border-color);
            border-radius: 16px;
            overflow: hidden;
            transition: transform 0.2s, box-shadow 0.2s;
            display: flex;
            flex-direction: column;
        }
        .product-card:hover {
            transform: translateY(-4px);
            box-shadow: 0 10px 15px -3px rgba(0, 0, 0, 0.5);
            border-color: var(--text-muted);
        }

        .card-header {
            padding: 20px;
            border-bottom: 1px solid var(--border-color);
        }

        .product-title {
            font-size: 1.1rem;
            font-weight: 600;
            line-height: 1.4;
            color: var(--text-main);
            margin-bottom: 10px;
            display: -webkit-box;
            -webkit-line-clamp: 2;
            -webkit-box-orient: vertical;
            overflow: hidden;
            height: 3.1em;
        }

        .badges { display: flex; gap: 8px; flex-wrap: wrap; }
        
        .badge {
            font-size: 0.75rem;
            padding: 4px 10px;
            border-radius: 9999px;
            font-weight: 600;
            text-transform: uppercase;
        }
        .badge-winner { background: rgba(34, 197, 94, 0.15); color: var(--accent-success); border: 1px solid rgba(34, 197, 94, 0.3); }
        .badge-saving { background: rgba(234, 179, 8, 0.15); color: var(--accent-warning); border: 1px solid rgba(234, 179, 8, 0.3); }

        .card-body {
            padding: 20px;
            flex-grow: 1;
        }

        .price-section {
            display: flex;
            justify-content: space-between;
            align-items: flex-end;
            margin-bottom: 20px;
        }
        
        .main-price { font-size: 2rem; font-weight: 800; color: white; letter-spacing: -1px; line-height: 1; }
        .main-price small { font-size: 0.9rem; font-weight: 400; color: var(--text-muted); display: block; margin-top: 5px; }
        
        .avg-price { text-align: right; }
        .avg-label { font-size: 0.75rem; color: var(--text-muted); text-transform: uppercase; }
        .avg-value { font-size: 1.1rem; color: var(--text-muted); text-decoration: line-through; }

        /* Tabla Comparativa Desplegable */
        .market-table-container {
            background: #0f172a;
            margin: 0 -20px -20px -20px;
            padding: 0;
            max-height: 0;
            overflow: hidden;
            transition: max-height 0.3s ease-out;
            border-top: 1px solid var(--border-color);
        }
        
        .product-card.active .market-table-container {
            max-height: 500px; /* Suficiente para mostrar competidores */
            overflow-y: auto;
        }

        .market-table {
            width: 100%;
            border-collapse: collapse;
            font-size: 0.85rem;
        }
        
        .market-table th, .market-table td {
            padding: 10px 20px;
            text-align: left;
            border-bottom: 1px solid var(--border-color);
        }
        
        .market-table th { color: var(--text-muted); font-weight: 600; background: #162032; position: sticky; top: 0; }
        .market-table td { color: var(--text-main); }
        
        .toggle-btn {
            background: transparent;
            border: none;
            width: 100%;
            padding: 12px;
            color: var(--accent-primary);
            font-weight: 600;
            cursor: pointer;
            border-top: 1px solid var(--border-color);
            transition: background 0.2s;
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 8px;
        }
        .toggle-btn:hover { background: rgba(59, 130, 246, 0.1); }

        /* Utilidades */
        .text-success { color: var(--accent-success); }
        .text-danger { color: var(--danger); }
        .hidden { display: none; }

    </style>
</head>

                                ${fmtMoney(p.Precio_Minimo)}
                                <small>Mejor Precio Detectado</small>
                            </div>
                            <div class="avg-price">
                                <div class="avg-label">Promedio Mercado</div>
                                <div class="avg-value">${fmtMoney(p.Precio_Promedio)}</div>
                            </div>
                        </div>
                    </div>

                    <button class="toggle-btn" onclick="toggleDetails(${index})">
                        ðŸ“Š Ver Comparativa de Mercado Completa
                    </button>

                    <div class="market-table-container">
                        <table class="market-table">
                            <thead>
                                <tr>
                                    <th>Competidor</th>
                                    <th style="text-align: right;">Precio Lista</th>
                                </tr>
                            </thead>
                            <tbody>
                                ${tableRows}
                            </tbody>
                        </table>
                    </div>
                `;
                grid.appendChild(card);
            });
        }

        function toggleDetails(index) {
            const card = document.getElementById(`card-${index}`);
            card.classList.toggle('active');
            const btn = card.querySelector('.toggle-btn');
            if (card.classList.contains('active')) {
                btn.innerHTML = 'ðŸ”¼ Ocultar Detalle';
                btn.style.borderTopColor = 'transparent';
            } else {
                btn.innerHTML = 'ðŸ“Š Ver Comparativa de Mercado Completa';
                btn.style.borderTopColor = '#334155';
            }
        }

        function filterProducts() {
            const query = document.getElementById('searchInput').value.toLowerCase();
            const filtered = products.filter(p => 
                p.Descripcion_Norm.toLowerCase().includes(query) || 
                p.Ganador.toLowerCase().includes(query)
            );
            renderProducts(filtered);
        }

        // Inicializar
        renderProducts(products);
    </script>
</body>
</html>
